                    <form>
                        <input type="text" value={this.state.name} placeholder="Name" name="name"/>
                        <input type="text" value={this.state.username} placeholder="Username" name="username"/>
                        <input type="text" value={this.state.email} placeholder="Email" name="email"/>
                        <input type="text" value={this.state.password} placeholder="Password" name="password"/>
                        <input type="text" value={this.state.password2} placeholder="Confirm password" name="password2"/>
                        <button>Signup</button>
                    </form>
                </div>
            </div>
        );
    }
}

